#coding=utf-8
class Solution:
    # @param {string[]} strs
    # @return {string[]}
    # 这个题：从头到尾遍历，把所有str的顺序形式存在一个map(dict)里
    # 然后dict里对应的是[0/1,str],0表示刚加进去，1表示已经不止出现一次了
    # 如果再一次搜索下一个str，如果dict中没有，则添加，如果有，如果第一位是0，把存的str和当前str都加入res
    # 然后flag置1，如果第一位是1，则只加当前str
    def anagrams(self, strs):
        dic = {}
        res = []
        for foo in strs:
            bar = foo[:]
            temp = "".join(sorted(bar))
            if temp in dic:
                if dic[temp][0]:
                    res.append(foo)
                else:
                    res.append(foo)
                    res.append(dic[temp][1])
                    dic[temp][0] = 1
            else:
                dic[temp] = [0,foo]
        return res




